import React from "react";
import Navbar from 'react-bootstrap/Navbar';
import Header from "./Header";
import Footer from "./Footer";

const BaseLayout = (props) => {
  return (
    <>
      <Header />

      {props.children}

      <br />
      <br />
     
    </>
  );
};

export default BaseLayout;
